export const ADD_ARTICLE = 'ADD_ARTICLE'
export const SET_AGE = 'SET_AGE'

type AddArticle = {type: typeof ADD_ARTICLE, payload: string}
type SetAge = {type: typeof SET_AGE, payload: number}

export const addArticle = (article: string): AddArticle => ({
  type: 'ADD_ARTICLE', 
  payload: article
})

export const setAge = (age: number): SetAge => {
  return {type: SET_AGE, payload: age}
}
